import React, { Component } from "react";
import "./App.css";

import SideDrawer from "./ChatComponents/SideDrawer";
import Demo from "./Demo";
import SignUp from "./Auth/SignUp";

class App extends Component {
  render() {
    return (
      <div className="App">
        { <div className="Scroll">
          <SideDrawer uid="ss" />
        </div> }

        <SignUp />
      </div>
    );
  }
}

export default App;
